import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { GroupDetailsComponent } from './group-details/group-details.component';



@NgModule({
  declarations: [
    GroupDetailsComponent
  ],
  imports: [
    CommonModule
  ]
})
export class GroupModule { }
